    def buildTree(tree, parent):
        childrenStart = tree.find("(")
        childrenEnd = tree.rfind(")")
        if childrenStart == -1:
            # print(tree)
            if not tree:
                tree = str(Tree.tree_id)
                Tree.tree_id += 1
            if Tree.n1 in tree:
                Tree.n1Tree = Tree(tree, [], parent)
                return Tree.n1Tree
            if Tree.n2 in tree:
                Tree.n2Tree = Tree(tree, [], parent)
                return Tree.n2Tree
            return Tree(tree, [], parent)
        rootName = tree[childrenEnd + 1:]
